import React from "react";

const input = (type, name) => 
{
  if (type==1)
  return(
    <input
    type="number"
    min="0" 
    max="100"
    placeholder={name}
    className="form-input-half"
    />
  )
  else if (type==2) return(
    <input
    type="text"
    placeholder={name}
    className="form-input"
    />
  )
  else if (type==3) return(
    <input
    type="date"
    placeholder={name}
    className="form-input-half"
    />
  )
}

export default input
